import { NavLink } from "react-router-dom";

export default function SingleButton({ title, icon, path }) {
  return (
    <NavLink
      to="/"
      style={({ isActive }) => ({
        color: isActive ? "greenyellow" : "white",
      })}
    >
      Home
    </NavLink>
  );
}
